  false,\n\t\"url\": null,\n\t\"notes\": \"This shapefile consists of 347 individual
  Aquatic Ecological System (AES) polygons that are the Aquatic Conservation Focus
  Areas for EPA Region 7. The focus areas are those areas within each aquatic ecological
  system types that, if preserved, would maintain the biological and ecological diversity
  extant within that ecological system type. The layer consists of those polygons
  from the R7_AES.shp shapefile that had the highest ranks. The AES polygons in the
  Missouri portion of the file were appended and are those that contain the 158 aquatic
  conservation opportunity areas identified in Missouri as part of another project
  (Missouri Department of Conservation Aquatic Biodiversity Assessment 2005). Note
  that the identifiers in the Missouri portion of this file will not match the ID's
  in any Missouri specific files.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
